  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117371 includes chemical,
  discrete sample, physical and profile data collected from HAKON MOSBY in the North
  Greenland Sea from 1994-02-03 to 1994-02-23 and retrieved during cruise CARINA/58AA19940203.
  These data include DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE, TOTAL ALKALINITY (TA) and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by I. Skjelvan of Commonwealth
  Scientific and Industrial Research Organization and O.M. Johannessen of Unknown
  as part of the CARINA/58AA19940203 data set.nnThe International CLIVAR Global Ocean
  Carbon and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
